script: |
  super -f text -I q5382.spq | sort > q5382.out

inputs:
  - name: q5382.spq
    data: |
      SELECT DISTINCT + cor1.col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5382.out
    data: |
      24
      35
      89
